var tipuesearch = {"pages": [{'title': 'About', 'text': 'Pyslvs-UI Official site:  https://github.com/KmolYuan/Pyslvs-UI \n Pyslvs Official site:  https://github.com/KmolYuan/pyslvs \n Metaheuristics Official site:  https://github.com/KmolYuan/metaheuristics \n', 'tags': '', 'url': 'About.html'}, {'title': 'Pyslvs-UI', 'text': 'Old data:  https://pyslvs.github.io/old \n Pyslvs-UI  的開發源自 2008 年, 從最基本的實數基因演算法在平面機構的應用研究起步, 期間歷經下列研究者的貢獻: \n \n 李孟恭, 2015,  Django 網際框架在平面四連桿尺寸合成系統上的應用 \n 李玠廷, 2013,  網際程式框架在平面連桿機構尺寸合成系統上的應用 \n 陳威任, 2013, 符號式平面滑塊機構應用研究 \n 謝政良, 2012,  網際雙自由度凸輪機構尺寸合成系統 \n 黃竣鉉, 2012,  網際符號輔助軸接連桿機構之基因演算法尺寸合成系統 \n 謝智翔, 2012,  網際史都華平台機構逆運動學分析與模擬 \n 許哲菘, 2010,  網際六軸機械臂系統的逆運動學分析與模擬 \n 葉岱錦, 2009,  基因演算法在網際機構合成系統上的應用 \n \n 過程中, 於 2015 年由 李孟恭 整合上述論文所開發的三種演算法, 完成  Cython  格式的  RGA 、 DE  與  Firefly  演算法程式庫後. 並自 2016 年起由 張元 將上述尺寸合成演算法, 搭配利用\xa0  SWIG  技術, 將原本只能用於 Python2 的  Python-Solvespace  倉儲, 改寫為能結合 PyQt 圖形介面使用的  Python-Solvespace  程式庫作為另一項開端. 再搭配平面機構中的數目合成與類型合成等程式庫後, 成為目前的\xa0 Pyslvs-UI  平面機構模擬與合成套件. \n Pyslvs 開發紀要 \n 2015 年 4 月 - 由 李孟恭 以\xa0 Cython  技術, 完成三個 尺寸合成演算法 程式庫. \n 2016 年 7 月 - 由 張元 完成 Python 3 格式的  Python-Solvespace  程式庫. \n 2016 年 12 月- 由 張元 結合 PyQt5 與演算程式庫, 完成第一代  Pyslvs-UI  套件. \n 2017 年 11 月 -  https://pyslvs.github.io  上線. \n 2018 年 1 月 - 推出  18.01.0  版, 自此改為以年月序作為版次. \n 2018 年 7 月 -\xa0 https://pyslvs.github.io/old  使用手冊上線. \n 2019 年 6 月 - Pyslvs-UI 正式 發表  ( EN ),  Thesis . \n 2023 年 12 月 -  https://pyslvs.github.io  資料重新整理中.', 'tags': '', 'url': 'Pyslvs-UI.html'}]};